import React, { Component, Fragment } from "react";
import EventoPreview from "./eventoPreview";

class showEventosAnteriores extends Component {
  render() {
    const { eventosPassados } = this.props;
    return (
      <Fragment>
        <div className="container">
          <div id="finished" className="card-panel z-depth-2">
            <h3 style={{ textAlign: "center" }}> Hist√≥rico de Eventos </h3>
            {eventosPassados.map(evento => (
              <EventoPreview evento={evento} key={evento.id} />
            ))}
          </div>
        </div>
      </Fragment>
    );
  }
}

export default showEventosAnteriores;
